import React from 'react';
import Styles from './Card.module.css';
import {Button} from '@material-ui/core';
const Card = (props)=>{
    const {src} = props;
    return (
        <div>
            <img className = {Styles.container} src = {src} height = '200px'>
            <Button color = 'secondary'>Guardar</Button>
            </img>
            
        </div>
    )
}
export default Card;
